import React from 'react'


export default function Video({name,url}) {
    return (
        <div className='card'>
           <video controls>
                <source src={require('../video\Cat.mp4')}
                type="video/mp4"></source>
           </video>
            <h3>{name}</h3>
        </div>
    )
}
